import { httpAction } from '@/api/manage';
import pick from 'lodash.pick';
import { getAction } from '@/api/manage';
export default {
  name: "UpdatePaperTitle",
  data: function data() {
    return {
      title: "操作",
      visible: false,
      model: {},
      labelCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 5
        }
      },
      wrapperCol: {
        xs: {
          span: 24
        },
        sm: {
          span: 16
        }
      },
      table: "",
      id: "",
      paperTitleName: "",
      confirmLoading: false,
      form: this.$form.createForm(this),
      validatorRules: {// ibusFunctionId:{rules: [{ required: true, message: '请输入主键id!' }]},
      },
      url: {
        editTitle: "/oaBus/oaBusdata/editTitle"
      }
    };
  },
  created: function created() {},
  methods: {
    paperTitle: function paperTitle(backData) {
      this.visible = true;
      this.table = backData.table;
      this.id = backData.i_id;
    },
    close: function close() {
      this.$emit('close');
      this.visible = false;
    },
    handleOk: function handleOk() {
      var _this = this;

      getAction(this.url.editTitle, {
        table: this.table,
        iId: this.id,
        sMiddleParameter: this.paperTitleName
      }).then(function (res) {
        if (res.success) {
          _this.$message.success(res.message);

          _this.$emit('ok');

          _this.$emit('updateMiddleParameter', _this.paperTitleName);

          _this.close();
        } else {
          _this.$message.warning(res.message);
        }
      });
    },
    handleCancel: function handleCancel() {
      this.close();
    }
  }
};
